import { Component } from 'react'
import Navigation from '../components/Navigation'
import Api from '../api/Api'

interface State {
    params: {
        skip: number,
        take: number
    }
    data: any
}

class Index extends Component<any, State> {

    constructor(props: any) {
        super(props)
        this.state = {
            params: {
                skip: 0,
                take: 4
            },
            data: []
        }
        console.log(`Constructor`)
    }


    static getDerivedStateFromProps = (props: any, state: State) => {
        console.log(`getDerived`)
    }

    componentDidMount = () => {
        this.apiData()
        console.log(`Mounted`)
    }


    componentDidUpdate = () => {
        console.log(`Update`)
    }

    apiData = (): void => {
        const api = new Api({})
        api.index(this.state.data).then(data => {
            this.setState({ data })
        })
    }


    render = (): JSX.Element => {

        console.log(this.state.data)
        console.log(`Render`)

        return (
            <>
                <Navigation />
                <div className="App">
                    <h1>Index</h1>
                </div>
            </>
        )
    }
}

export default Index
